import React, {useEffect,useState} from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";

function AddItem(){
  const navigate = useNavigate();
  const [Inventory, setInventory] = useState({
    itemId: "",
    itemName: "",
    itemCategory: "",
    itemQty: "",
    itemDetails: "",
    itemImage: null,
  });
  const { itemId, itemName, itemCategory, itemQty, itemDetails, itemImage } = Inventory;
  const onInputChange = (e) => {
    if(e.target.name === "itemImage") {
      setInventory({ ...Inventory, [e.target.name]: e.target.files[0] });
    }else {
      setInventory({ ...Inventory, [e.target.name]: e.target.value });

    }
}
  const onsubmit = async (e) => {
    e.preventDefault();
    const formData = new FormData();
    formData.append("file", Inventory.itemImage);
    let imageName = Inventory.itemImage.name;
  

    try {
      await axios.post("/api/inventory/addItem", formData, {
        headers: {
          "Content-Type": "multipart/form-data",
        },
      });
      alert("Item added successfully!");
      navigate("/");
    } catch (error) {
      console.error("Error adding item:", error);
      alert("Failed to add item. Please try again.");
    }
  }

  return (
    <div>
      <p className="auth_topic">Add Item</p>
      <div className="form_container">
        <div className="form_sub_container">
          <form id="itemForm">
            <label htmlFor="itemId">Item ID:</label>
            <br />
            <input type="text" id="itemId" name="itemId" required />
            <br />
            
            <label htmlFor="itemName">Item Name:</label>
            <br />
            <input type="text" id="itemName" name="itemName" required />
            <br />
            
            <label htmlFor="itemCategory">Item Category:</label>
            <br />
            <select id="itemCategory" name="itemCategory" required>
              <option value="" disabled>
                Select Item Category
              </option>
              <option value="Apparel & Fashion">Apparel & Fashion</option>
              <option value="Electronics & Gadgets">Electronics & Gadgets</option>
              <option value="Health & Beauty">Health & Beauty</option>
              <option value="Food & Dining">Food & Dining</option>
              <option value="Home & Furniture">Home & Furniture</option>
            </select>
            <br />

            <label for="itemWty">Item Quantity</label><br />
            <input type="number" id="itemQty" name="itemQty" required /><br />
            
            <label htmlFor="itemDetails">Item Details:</label>
            <textarea id="itemDetails" name="itemDetails" rows="4" cols="50" required></textarea>
            <br />

            <label htmlFor="itemImage">Item Image:</label>
            <input 
                  type="file" 
                  id="itemImage" 
                  name="itemImage" 
                  accept="image/*" 
            />
            <br />
            <button type="submit" className="fom_btn">Submit</button>
          </form>
        </div>
      </div>
    </div>
  );
}

export default AddItem;
